INSERT INTO CuidadoAfricano(nombretaxonomico,cuidado) VALUES ('Lecanora pulicaris (Pers.) Ach.','Nunc purus. Phasellus in felis. Donec semper sapien a libero. Nam dui.');
INSERT INTO CuidadoAfricano(nombretaxonomico,cuidado) VALUES ('Cercocarpus montanus Raf. var. montanus','Vivamus metus arcu, adipiscing molestie, hendrerit at, vulputate vitae, nisl. Aenean lectus. Pellentesque eget nunc. Donec quis orci eget orci vehicula condimentum. Curabitur in libero ut massa volutpat convallis. Morbi odio odio, elementum eu, interdum eu, tincidunt in, leo. Maecenas pulvinar lobortis est. Phasellus sit amet erat.');
